import React, { useState } from "react"
import apiService from "../services/api"

const LogFilter = () => {
   const [startDate, setStartDate] = useState('')
   const [endDate, setEndDate] = useState('')
   const [keyword, setKeyword] = useState('')
   const [filteredLogs, setFilteredLogs] = useState([])

   const handleFilter = async () => {
      try {
         const logsData = await apiService.filterLogs(startDate, endDate, keyword)
         setFilteredLogs(logsData)
      } catch (error) {
         console.error('Error filtering logs:', error)
      }
   }

   return (
      <div>
         <h1>Log Filter</h1>
         <input
            type="text"
            placeholder="Start Date (YYYY-MM-DD)"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
         />
         <input
            type="text"
            placeholder="End Date (YYYY-MM-DD)"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
         />
         <input
            type="text"
            placeholder="Search keyword..."
            value={keyword}
            onChange={(e) => setKeyword(e.target.value)}
         />
         <button onClick={handleFilter}>Filter</button>

         <ul>
            {filteredLogs.map((log) => (
               <>
               <li key={log._id}> I{log._id}</li>
               <li key={log.ip_address}>{log.ip_address}</li>
               <li key={log.date}>{log.date}</li>
               <li key={log.time}>{log.time}</li>
               <li key={log.username}>{log.username}</li>
               <li key={log.version}>{log.version}</li>
               <li key={log.document}>{log.document}</li>
               <li key={log.description}>{log.description}</li>
               <br />
               </>
            ))}
         </ul>
      </div>
   )
}

export default LogFilter
